VALUES ('3760280000202', 'vin rosé Pays d\'Oc', 'GRENACHE SYRAH 2017 belle robe rose brillante, ce rosé, savant assemblage de D\'une belle robe Grenache et de Syrah, exhale au nez des arômes d fruits rouges et agrumes. La bouche élégante et bien équilibrée, se termine pur une belle fraicheur. Très facile à boire, ce rosé très fruité sera le compagnon idéal pour vos apéritifs ainsi que tout au long du repas. Association mets et vins : salades composés, viandes blanches grillees, poissons grillés. Température de service idéale: entre 5 et 9°C. EAN 3760280002 PAYS D\'OC INDICATION GEOGRAPHIQUE PROTÉGEE Mis en bouteille par CVS à F11590 pour OENO TERRA À F34500 12,5%vol PRODUIT DE FRANCE C1146  Contient des sulfites L1983РВ', 'https://static.openfoodfacts.org/images/products/376/028/000/0202/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

